import React from 'react'
import { GU, useViewport } from '@1hive/1hive-ui'
import { MENU_PANEL_WIDTH } from '../MenuPanel'
import HomeChart from '../LineChart/HomeChart'

const MyWallet = React.memo(() => {
  const { width: vw } = useViewport()
  return (
    <div
      css={`
        display: flex;
        flex-direction: row;
        padding-top: ${3 * GU}px;
        padding: 20px;
        width: ${vw - MENU_PANEL_WIDTH}px;
      `}
    >
      <div
        css={`
          display: flex;
          flex-direction: column;
          justify-content: center;
          width: ${MENU_PANEL_WIDTH * 0.2}px;
        `}
      >
        <span>Net Value</span>
        <span>$10,000</span>
      </div>
      <HomeChart height={GU * 15.75} width={vw * 0.8} />
    </div>
  )
})

export default MyWallet
